INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1260, 0, 1, 7, N'Weingut Rabl, Gruner Veltliner, Austria', 25, N'Lovely aromas of spicy grapefruit and tropical fruit harmonise with mineral notes on the palate through to an elegant, crisp finish. (800 pp)', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1261, 0, 1, 7, N'Chateau Ksara, Blanc de Blancs, Bekaa Valley, Lebanon', 22, N'The Sauvignon gives this winew its subtlw aroma of hazelnuts and exotic fruits, the Chardonnay gives this wine its finesse and elegance, and the Semillon provides roundness and length.  The result is an elegant wine with a complex aroma of spice, pineapple and nuts which is followed through on the palate.  Medium bodied, balanced acidity and a medium to long finish. (710pp)', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1262, 0, 1, 7, N'Riesling Domaine Von Bhul, Pfalz, Germany', 34.95, N'"""Von Buhl makes scintillating wines and this dry Riesling shows the magical properties of this aweinspiring grape off to a tee. With pinpoint accurate citrus fruit you need to rustle up the sesame crusted salmon, prawn and orange stir-fry and marvel at the synergy of this food and wine combination"" Matthew Jukes, Mail on Sunday 2014 (1000 pp)"', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1263, 0, 1, 7, N'Domaine Saint Remy Gewurztraminer,Alsace, France', 27.5, N'A very fresh and citrusy nose with hints of lychee, rose, minerals and fleshy apricot.  Off-dry, soft acidity, slightly oily and honeyed with a gentle gewurtraminer character.  Pleasantly mineral with, like the nose, a wonderful citrus freshness.  2009+(840 pp)', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1264, 0, 1, 7, N'Chablis, Domaine louis Robin, Burgundy, France', 35, N'Splendid Chablis from a small family Domaine.  This harmonious, elegant wine reveals interwoven nuances of just-ripe yellow stone fruits, butter, sea smoke & mineral.  A generous, focused wine that feels light on its feet wilst finishing pure & long.  2011+ (1100 pp)', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1265, 0, 1, 7, N'Pazo Senorans Albarino, Rias Baixes, Galicia, Spain', 32, N'"2013 WINES FROM SPAIN AWARD WINNER: Best Premium White Wine.  "" .. Jasmine, mineral, lemon zest, and other citrus notes inform the nose of this multi-dimensional, already complex white.  On the palate tropical flavours emerge adding to the wine''s pleasure quotient.."" 93/100 Robert Parker.  2010+ (1000 pp)"', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1266, 0, 1, 7, N'Chassagne-Montrachet, Domaine Patrick Miolane, Burgundy, France', 44, N'A highly attractive bouquet showing vibrant citrus fruit orange peel.  A mouth coating Chassagne with light, clear honey, quince and aniseed notes, building nicely towards a composed, vivacious finish.  This is one of the best releases from the domaine this year.  Excellent. (1300 pp)', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1267, 0, 1, 7, N'Abel Mendoza Rioja Blanco, Rioja Alta, Spain', 48, N'Has a wonderful, complex bouquet of grapefruit, dried pineapple, honeysuckle, melted candle wax and Turkish Delight that is utterly seductive.  The palate is supremely well balanced with deftly integrated oak.  There are hints of fresh apricot, tangerine, coconut, lychee and passion fruit, but none of those flavours are dominent, and they are crystalline on the finish.  This is a compelling white Rioja.  2009+ (1430 pp)', N'', 1, 10, 1, 0)
GO
