INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1307, 0, 1, 7, N'Smoking Loon Zinfandel, USA', 36, N'An old vine Zinfandel with aromas of fig, black cherry & sandelwood.  Fruit driven & full bodied with ripe red raspberry, boysenberry, red cherry.  Hints of baked spices & dried strawberries add complexity.  This is lovely Zinfancel belongs with red meat! 2010+ (1200 pp)', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1308, 0, 1, 7, N'Bodega Angosto, La Tribu, Valencia- Spain', 24.95, N'90 points from Robert Parker (Wine Critic).  La Tribu is made up of equal parts Monastrell, Garnacha and Syrah aged in oak for 4 months.  Aromas of meat, game, blackberry, and blueberry are followed by a succulent, impeccably balanced, friendly wine that offers outstanding value. (790 pp)', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1309, 0, 1, 7, N'Chateau Fleur de Lisse, St Emilion, France', 29.95, N'The style is rich and rounded with flavours of red berry, spice and a hint of jamminess.  Well balanced with fine soft tannins. (890 pp)', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1310, 0, 1, 7, N'Shiraz, Michel Chapoutier ''Domaine Tournon'' Victoria, Australia', 32, N'The nose displays lifted notes of ripe blackberry, dark plum, dried meats, a touch of liquorice and a strong black pepper ent note.  Full bodied but perfectly balanced.  Excellent length with long ripe blackberry, black cherry, liquorice and black pepper aftertaste.  2009+ (1200pp)', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1311, 0, 1, 7, N'Chateauneuf-du-Pape Pierre Usseglio Classique, France', 42, N'one of the finest Chateauneuf-du-Papes money can buy is Pierre Usseglio''s offeing composed of 80% Grenache & the rest Syrah, Mourvedre and Cinsault.  It possesses a dark ruby/purple colour, intense fruit, lots of garrigue, pepper & spice box, a medium to full-bodied texture and a heady finish. 90 points.  Robert Parker.  2008+ (1500 pp)', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1312, 0, 1, 7, N'Fincas La Chamiza Malbec Reserva ''Polo Professional'' Mendoza, Argentina', 28.5, N'A deep brooding malbec aged for 6 months in french oak barrels.  Opaque purple in colour, great nose of toasty oak, black cherry, espresso & blackberry.  Full bodied with ripe, cherry and plum flavours - this is a beast of a Malbec! (870 pp)', N'', 1, 10, 1, 0)
GO
INSERT [dbo].[MenuItems] ([Id], [MenuGroupId], [TaxTypeId], [RestaurantId], [Name], [Price], [Description], [ImageURL], [Deleted], [PrinterId], [MenuItemTypeId], [Unavailable]) VALUES (1313, 0, 1, 7, N'Vino Marro Rioja Reserva, Spain', 32, N'Crafted from the oldest Tempranillo vines in the vineyard.  Aged for 24 months in oak barrels and more that 18 months in the bottle.  Revealing expressive aromatics of sweet spice, dark cherry & spicy wood.  A powerful, full- bodied palate with a firm structure framing flavoours of cherries, raspberries, leatehr, vanilla & Asian spice - superb length. (950 pp)', N'', 1, 10, 1, 0)
